package com.biocv.boot.client;

import io.netty.buffer.ByteBuf;
import io.netty.buffer.Unpooled;
import io.netty.channel.ChannelHandlerContext;
import io.netty.channel.ChannelInboundHandlerAdapter;

import java.io.UnsupportedEncodingException;
import java.nio.charset.StandardCharsets;

/**
 * Handler implementation for the echo client.  It initiates the ping-pong
 * traffic between the echo client and server by sending the first message to
 * the server.
 */
public class EchoClientHandler extends ChannelInboundHandlerAdapter {

    private final ByteBuf firstMessage;

    /**
     * Creates a client-side handler.
     */
    public EchoClientHandler() throws UnsupportedEncodingException {
        String msg = "{\n" +
                "\t\"payload\": {\n" +
                "\t\t\"params\": {\n" +
                "\t\t\t\"sn\": \"xxxxxxx\",\n" +
                "\t\t\t\"secret\": \"xxxxxxx\",\n" +
                "\t\t\t\"users\": {\n" +
                "\t\t\t\t\"address\": \"xxxxxxx\",\n" +
                "\t\t\t\t\"pin\": \"xxxx\",\n" +
                "\t\t\t\t\"nation\": \"xxxxxxx\",\n" +
//                "\t\t\t\t\"phone\": \"\",\n" +
                "\t\t\t\t\"sex\": \"xxxxxxx\",\n" +
                "\t\t\t\t\"name\": \"xxxxxxx\",\n" +
                "\t\t\t\t\"fingerprint\": [{\n" +
                "\t\t\t\t\t\"template\": \"xxxxxxxxxx\",\n" +
                "\t\t\t\t\t\"index\": \"0\"\n" +
                "\t\t\t\t}],\n" +
                "\t\t\t\t\"birth\": \"xxxxxxx\",\n" +
                "\t\t\t\t\"photo\": \"xxxxxxx\",\n" +
                "\t\t\t\t\"identity_number\": \"350623xxxxxxxxxxx\",\n" +
                "\t\t\t\t\"identity_photo\": \"xxxxxxx\",\n" +
                "\t\t\t\t\"card\": \"xxxxxxx\"\n" +
                "\t\t\t}\n" +
                "\t\t}\n" +
                "\t},\n" +
                "\t\"funcId\": \"device.upload.user\"\n" +
                "}";
        firstMessage = Unpooled.buffer();
        firstMessage.writeBytes(msg.getBytes(StandardCharsets.UTF_8));
//        firstMessage = Unpooled.buffer(EchoClient.SIZE);
//        for (int i = 0; i < firstMessage.capacity(); i ++) {
//            firstMessage.writeByte((byte) i);
//        }
    }

    @Override
    public void channelActive(ChannelHandlerContext ctx) {
        ctx.writeAndFlush(firstMessage);
    }

    @Override
    public void channelRead(ChannelHandlerContext ctx, Object msg) {
        ctx.write(msg);
    }

    @Override
    public void channelReadComplete(ChannelHandlerContext ctx) {
       ctx.flush();
    }

    @Override
    public void exceptionCaught(ChannelHandlerContext ctx, Throwable cause) {
        // Close the connection when an exception is raised.
        cause.printStackTrace();
        ctx.close();
    }
}
